INSERT INTO `pus_katalog` (`replid`, `judul`, `klasifikasi-kode`, `klasifikasi`, `callnumber`, `pengarang`, `penerbit`, `isbn`, `issn`, `penerjemah`, `tahunterbit`, `editor`, `photo`, `kota`, `volume`, `seri`, `edisi`, `halaman`, `dimensi`, `bahasa`, `jenisbuku`, `deskripsi`) VALUES
(1, 'Tiga manula jalan-jalan ke Selatan Jawa`', '741.5', 15, '741.5 RAC t', 14, 4, '9789799106308', '', '', '2013', '', '', 'Jakarta', '', '', '', 96, '17 cm', 1, 3, 'Pantang menyerah mencari Tingal, desa kelahiran Waluyo, Tiga Manula kini menyusuri Selatan Jawa. Tiga makam presiden diziarahi, Solo-Yogya dinikmati, Candi Borobudur didaki, Nusakambangan dijelajahi, dan beragam kuliner dicicipi. Dimanakah sebenarnya'),
(2, 'Sally Ann thunder Ann whirlwind crockett`', '813', 16, '813 KEL s', 19, 9, '0590969994', '', '', '1995', '', '', 'New York', '', '', '', 48, '28 cm', 2, 3, 'Sally ann thunder ann is the strongest, fastes woman around. But is she strong enough to rescue Davy Crockett and beat the mighty Mike Fink.'),
(3, 'Crime and Punishment`', '813', 16, '813 DOS c', 12, 5, '9781840224306', '', '', '2000', '', '', 'London', '', '', '', 486, '20 cm', 2, 3, 'This book is one of the greatest and most readable novels ever written. From the beginning we are locked into the frenzied consciousness of Raskolnikov who, againts his better instinest, is inexorably draw to commit a brutal double murder.'),
(4, 'Sunshine becomes you`', '823', 12, '823 TAN s', 9, 4, '9789792278132', '', '', '2012', '', '', 'Jakarta', '', '', '', 432, '20 cm', 1, 3, 'Awalnya, Alex Hirano lebih memilih jauh-jauh dari gadis itu-malaikat kegelapan yang membuatnya cacat. Kemudian Mia Clark tertawa, dan Alex bertanya-tanya bagaimana ia bisa berpikir gadis yang memiliki tawa secerah matahari itu adalah malaikat kegelap'),
(5, 'Hiu dan monster bawah laut`', '597.3', 14, '597.3 BAR h', 13, 15, '9786020032825', '', 'KURNIAWAN, Andri', '2012', '', '', 'Jakarta', '', '', '', 190, '18cm', 1, 3, 'Menampilkan lebih dari 80 hiu paling menakutkan dan terburuk di dunia, lintah, aligator, cumi-cumi dan binatang bawah air lainnya.'),
(6, 'Tarzan kota`', '823', 12, '823 SUP t', 16, 7, '9792110747', '', '', '2005', '', '', 'Yogyakarta', '4', 'Tito', '', 28, '25 cm', 1, 3, 'Tito adalah tokoh kucing yang sok aksi. Dia suka usil dan kadang-kadang juga nakal. Meskipun demikian, Tito punya kelebihan, misalnya pandai bergaul, tidak mudah sakit hati, dan selalu menyesali kesalahannya.'),
(7, '5 cm`', '823', 12, '823 DHI 5', 15, 14, '9789790818521', '', '', '2013', 'NUSANTARA, A. Ariobimo', '', 'Jakarta', '', '', '', 382, '21 cm', 1, 3, 'Sore ini, setelah menyelesaikan halaman terakhir 5 cm-nya Donny Dhirgantoro, saya terdiam lama dan menangis. Buku ini, entah bagaimana, membuat saya memandang dunia, hidup, dan segala sesuatu di sekitar saya, dengan cara yang berbeda.'),
(8, 'Getting around in the city`', '813', 16, '813 ADA g', 20, 10, '0153276509', '', '', '0', '', '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'I kive in the city. It is a big, busy place. There are so many ways to get around in the city.'),
(9, 'Yes you can, Kerry`', '813', 16, '813 APP y', 21, 10, '0153230754', '', '', '0', '', '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'It was the first day of school. Nine young fish were gathered there. Most clustered in a shell waiting for the teacher.'),
(10, 'Huggly''s halloween`', '813', 16, '813 ARN h', 22, 9, '0439324491', '', '', '2002', '', '', 'New York', '', '', '', 30, '20 cm', 2, 3, 'Huggly and his friends live in the monster world. But sometimes the human world is just too hard to resist. That''s when the fun begins...'),
(11, 'Huggly goes to school`', '813', 16, '813 ARN h', 22, 9, '0439134994', '', '', '2000', '', '', 'New York', '', '', '', 30, '20 cm', 2, 3, 'Huggly doesn''t realize that his perfect hide-and-seek hiding spot is...a school. Can Huggly and his friends pretend to be people without getting caught.'),
(12, 'Tommy tractor''s new job`', '813', 16, '813 AND t', 23, 11, '1841352578', '', '', '2003', '', '', 'London', '', '', '', 28, '23 cm', 2, 3, 'Tommy tractor has a very busy job throughout the year on Parship farm. But when farmer peadley becomes ill, life begins to change.'),
(13, 'Lukisan ajaib bidadari`', '823', 12, '823 SUP l', 16, 0, '9792104240', '', '', '2006', '', '', 'Yogyakarta', '5', 'Pan-pan', '', 28, '25 cm', 1, 3, 'Pan Pan, singkatan dari panda yang pandai, adalah tokoh dari dunia panda. Pan pan adalah panda yang cerdas, setia kawan, dan baik hati. Ia mempunyai sahabat bernama Blonda yg bloon dan mudah terhasut.'),
(14, 'The testament`', '823', 12, '823 GRI t', 11, 4, '9789792261868', '', 'SETIADI, Hendarto', '2010', '', '', 'Jakarta', '', '', '', 620, '18 cm', 1, 3, 'Troy Phelan, miliader yang sukses berkat kerja keras seumur hidupnya, eksentrik, suka menyendiri dan hidupnya terikat pada kursi roda, memilih mengakhiri riwayatnya dengan terjun dari lantai empat belas gedung perkantorannya.'),
(15, 'Three women looking for love`', '823', 12, '823 VIR t', 10, 4, '9789792289138', '', '', '2012', '', '', 'Jakarta', '', '', '', 270, '20 cm', 1, 3, 'Kami bertiga dipersatukan takdir sebagai lajang terakhir di angkatan SMA. Berusia kepala tiga, kami senasib-sepenanggungan. Kami saling berbagi, saling menguatkan, juga saling bersaing diam-diam.'),
(16, 'Dia, tanpa aku`', '823', 12, '823 KIN d', 8, 0, '9789792234411', '', '', '2011', '', '', 'Jakarta', '', '', '', 276, '', 1, 3, 'Ronald, cowok kelas 2 SMA, sudah lama naksir Citra yang masih kelas 3 SMP. Tapi Ronald belum mau PDKT. Ia menunggu sampai Citra masuk SMA, karena itu ia hanya bisa mengamati Citra dari jauh.'),
(17, 'Rustie gets dirty`', '813', 16, '813 CHA r', 24, 12, '', '', '', '2002', '', '', '', '', 'Little Puppy Tails', '', 8, '17 cm', 2, 1, 'Rustie loves to dig in the garden and play in the leaves. But only clever Rustie knows how to clean up at the end of a dirty day.'),
(18, 'The stories huey tells`', '813', 16, '813 CAM t', 25, 0, '0679885595', '', '', '1995', '', '', 'New York', '', '', '', 102, '19 cm', 2, 3, 'It isn''t easy being Julians younger brother. When Huey has bad dream, Julian says his are scarier. And when Huey wants to study animal tracks, Julian says he''s too young.'),
(19, 'Everything on Olvera street`', '813', 16, '813 COL e', 26, 10, '0153230959', '', '', '0', '', '', 'Orlando', '', '', '', 16, '21 cm', 2, 3, 'Last summer I visited my aunt Helen in Los Angeles, California. On my first saturday, Aut Helen enjoyed a late Breakfast.'),
(20, 'Jackrabbit goalie`', '813', 16, '813 CHR j', 28, 0, '0316139750', '', '', '0', '', '', 'Canada', '', '', '', 48, '21 cm', 2, 3, 'Anxious to make friends in a new town, a young boy lies about his experience as goalie in order to get on the local soccer team.'),
(22, 'Tell me a story of a cake`', 'FIC', 11, 'FIC AGI t', 31, 0, '9796726696', '', '', '2001', '', '', '', '', '', '', 1, '', 2, 3, 'I''m a big cake. I''m very delicious'),
(23, 'Little lily at clockland`', '813.23', 179, '813.23 ARL l', 34, 0, '9792223193', '', '', '2006', '', '', 'Jakarta', '', '', '', 23, '', 2, 3, 'Lily and her friends were learning to tell the time at school.'),
(24, '105 cerita alkitab anak kecil`', '220.95', 20, '220.95 RIK 1', 35, 0, '9789796879946', '', 'Santoso Sri Buwono', '2012', '', '', 'Jakarta', '', '', '', 447, '', 1, 1, 'Buku ini berisikan 105 cerita alkitab favorit yang diceritakan kembali bagi anak kecil.'),
(25, 'Marmut merah jambu`', '823', 12, '823 DIK m', 37, 0, '9786028066648', '', '', '2010', 'ARIESTANTY, Windy', '', 'Jakarta', '', '', '', 218, '20 cm', 1, 3, 'Momennya lagi pas banget, pikir gue.Seperti yang Ara tadi anjurkan lewat telepon, ini adalah saatnya gue bilang ke Ina kalo gue sangat menikmati malam ini.'),
(26, 'Sleeping beauty`', '813', 16, '813 ROW s', 38, 20, '0721416918', '', '', '1994', '', '', 'Maine', '', '', '', 30, '18 cm', 2, 1, 'Once upon a time there was a king and queen who had long hoped for a child of their own. When, at last, a baby princess was born, they thought that a good fairy must have been looking after them.'),
(27, 'Paul Bunyan`', '920', 13, '920 KLE p', 39, 10, '0153230819', '', '', '0', '', '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'Paul Bunyan was born in Maine. He was so big, his cradle was put in the ocean. The waves rocked him to sleep.'),
(28, 'The busy busy day`', '813', 16, '813 FRE t', 40, 0, '1845060075', '', '', '2005', '', '', 'London', '', '', '', 31, '26 cm', 2, 3, 'It''s springtime. Ginger and Floppy decide to spend a busy day in the garden. They put on their gloves and boots and rush outside:'),
(29, 'Can''t you sleep, Little Bear`', '813', 16, '813 WAD c', 41, 22, '9781844284917', '', '', '2005', '', '', 'London', '', '', '', 30, '26 cm', 2, 3, 'Little Bear cant sleep. There is dark all around him in the Bear Cave. Not even big Bears biggest lantern can light up the darkness of the night outside.'),
(30, 'I like to learn things my way`', '813', 16, '813 MAZ i', 42, 23, '983000497X', '', '', '2003', '', '', 'Johor Baru', '', '', '', 24, '22 cm', 2, 3, 'Princess Shelly is only four year old, but she faces tremendous presusure from her parents to learn the many social skills and graces that befit her status.'),
(31, 'My body`', '611', 143, '611 ALT m', 43, 24, '9789380152080', '', '', '2011', '', '', 'Okhla Industrial Are', '', '', '', 25, '28 cm', 2, 1, 'why does the heart beat. why is a skeleton needed. How does the body move.'),
(32, 'The adventures of Hercules`', '741.5', 15, '741.5 POW t', 44, 25, '9781406214277', '', '', '2009', '', '', 'London', '', '', '', 72, '23 cm', 2, 3, 'The son of a mortal woman and the king of the Gods, Hercules is blessed with extraordinary strenght.'),
(33, 'Theseus and the Minotaur`', '741.5', 15, '741.5 YOM t', 45, 25, '9781406214307', '', '', '2009', '', '', 'London', '', '', '', 72, '23 cm', 2, 3, 'Theseus, the brave prince of Athens, has performed many great feats, but his most daunting task is yet to come.'),
(34, 'Little red riding hood`', '813', 16, '813 CHI l', 46, 23, '9830001563', '', '', '2003', '', '', 'Johor Bahru', '', '', '', 24, '22 cm', 2, 3, 'Once upon a time there was a pretty little girl who lived with her parents in a little cottage. She had a grandmother who lived at the far end of the village.'),
(35, 'What lives on your body`', '595.7', 144, '595.7 WOO w', 47, 26, '190246334X', '', '', '2002', '', '', 'London', '', '', '', 48, '30 cm', 2, 3, 'Did you know that there are millions of microscopic creatures that lives on and inside your body-mostly so small that you don''t even notice them.'),
(36, 'Naga`', '821', 131, '821 TAT n', 49, 8, '01010255', '', 'TYAS, Damaring', '2005', 'RACHMAWATI, Mila', '', 'Jakarta', '', '', '', 16, '22 cm', 1, 1, 'Ada ratusan cerita mengenai naga dari seluruh dunia. Ada naga galak bernapaskan api yang menjaga timbunan harta karun yang berkilauan.'),
(37, 'What lives under the carpet`', '595.7', 144, '595.7 WOO w', 47, 26, '1902463234', '', '', '2000', 'WARD, Beck', '', 'London', '', '', '', 48, '30 cm', 2, 3, 'Everthing you ever wanted to know about the world of creepy-crawlies, bugs and insects in and around your home.'),
(38, 'Cerita rakyat:Woiram`', '813.23', 179, '813.23 ELI c', 50, 4, '9796699443', '', 'JOHNSON, Caroline', '2000', 'ENESTE, Pamusuk', '', 'Jakarta', '', '', '', 24, '', 5, 3, 'Cerita rakyat sebagai akar budaya indonesia, diwariskan dalam tradisi lisan masyarakat. Pelestarian tradisi lisan itu jga tertuang dalam gambar-gambar prangko seri cerita rakyat.'),
(39, 'Cerita rakyat:Danau toba`', '813.23', 179, '813.23 ELI c', 50, 4, '9796698714', '', 'JOHNSON, Caroline', '2000', 'ENESTE, Pamusuk', '', 'Jakarta', '', '', '', 24, '15 cm', 5, 3, 'Cerita rakyat sebagai akar budaya indonesia, diwariskan dalam tradisi lisan itu juga tertuang dalam gambar-gambar prangko seri cerita rakyat.'),
(40, 'Sam''s chase`', '813', 16, '813 BLA s', 51, 10, '0153230916', '', '', '1990', '', '', 'Orlando', '', '', '', 16, '20 cm', 2, 3, 'Narrator: Sam comes home from the park and finds a postcard. It is not a typical note.'),
(41, 'The big snowman`', '813', 16, '813 BER t', 52, 9, '0590444395', '', '', '0', '', '', 'New York', '', '', '', 48, '25,5 cm', 2, 3, 'Honk-honk-honk. The wiil geese fly south when cold winds begin to blow from the north.'),
(42, 'Red light, green light, Mama and Me`', '813', 16, '813 BES r', 53, 0, '0590341995', '', '', '1995', '', '', 'New York', '', '', '', 32, '25 cm', 2, 3, 'Red light, greem light, one, two, three. I sing as mama and i hurry across the morning street.'),
(43, 'The scarecrow''s hat`', '813', 16, '813 BRO t', 54, 9, '0439355478', '', '', '2001', '', '', 'New York', '', '', '', 26, '27 cm', 2, 3, 'That''s a nice hat, said Chicken to scarecrow. Yes, it is, replied Scarecrow. But I''d rather have a walking stick.'),
(44, 'Teddy''s snowy day`', '813', 16, '813 BEC t', 55, 9, '0439574331', '', '', '1998', '', '', 'New York', '', '', '', 32, '23 cm', 2, 3, 'After a night of snow, the world was white. Lily and Teddy looked through the window. Let''s go out and play, Lily said.'),
(45, 'Just in time for Christmas`', '813', 16, '813 BOR j', 56, 9, '0590453564', '', '', '1994', '', '', 'New York', '', '', '', 39, '25,5 cm', 2, 3, 'The holiday season is here at last. It''s time for the Bryans to make their sweet cream candy, and will can''t wait.'),
(46, 'Babbity''s big bad mood`', '813', 16, '813 BUT b', 57, 0, '9781845068592', '', '', '2009', '', '', 'London', '', '', '', 27, '26 cm', 2, 3, 'Bother those noisy birds,muttered Babbity. And bother the sun as well. Oh dear, what a bad mood Babbity is in.'),
(47, 'Toot and Puddle A present for toot`', '813', 16, '813 HOB t', 58, 9, '0439061687', '', '', '1998', '', '', 'London', '', '', '', 32, '28 cm', 2, 3, 'It was already tuesday, and toot''s for birtday was on friday. Puddle wanted to get him the best persent ever.'),
(48, 'The Berenstain bears: get stage fright`', '813', 16, '813 BER t', 60, 27, '9780394873374', '', '', '1986', '', '', 'New York', '', '', '', 32, '20 cm', 2, 3, 'One way to school one day sister bear, brother bear, and cousin Freddie go to talking about an important subject: their teachers.'),
(49, 'Alice in wonderland`', '741.5', 15, '741.5 POW a', 44, 25, '9781406214185', '', '', '2010', 'LEMKE, Donald', '', 'London', '', '', '', 63, '23 cm', 2, 3, 'Lewis Carroll''s timeless tale of a young girl who fall into a strange, dreamlike world is masterfully adapted by Eisner Award nominee Martin Powell and artist Daniel Perez...'),
